    function addSlashesToDate(input) { 
        if(input.length == 2){
            return input.slice(0, 2) + '/';
        } else if(input.length == 5) {
            return input.slice(0, 3) + input.slice(3, 5) + '/';
        } else if(input.length == 10) {
        return input;
        } else {
            return input.slice(0, 10);
        }
    }
    

